import React from 'react';
import './Searchpage.css';

const Searchpage = () => {
  return (
    <div className='search-page'>
      <div className='search-page-info '>
        <p>
          26 August to 30 August - 3 items
        </p>
        <h1>Transforming Business Sustainability</h1>
      </div>
    </div>
  )
}

export default Searchpage;
